predictVictory :: String -> String -> Double
predictVictory t1 t2 =
  case lookup (t1,t2) probs of
    Just (v,_,_) -> v
    Nothing -> 0.333

predictDraw :: String -> String -> Double
predictDraw t1 t2 =
  case lookup (t1,t2) probs of
    Just (_,d,_) -> d
    Nothing -> 0.333

predictLoss :: String -> String -> Double
predictLoss t1 t2 =
  case lookup (t1,t2) probs of
    Just (_,_,l) -> l
    Nothing -> 0.333
